var posParcial = String(FeriadoParcial).indexOf(diaHoje);

if (posDia >= 0) {
  //formato ddMM;ddMM;
  aplFeriado = true;
  logger.info('Feriado (dia Inteiro: ' + FeriadoDiaTodo.substr(posDia, 4) + ')');
} else if (posParcial >= 0) {
  //formato ddMM:HHmm-HHmm;ddMM:HHmm-HHmm
  logger.info('Feriado Parcial Dia achado (' + FeriadoDiaTodo.substr(posParcial, 14) + '), falta ver horas');
  posParcial += 5; //soma 5 para achar intervalo de hora
  var horaInicial = String(FeriadoParcial).substr(posParcial, 4);
  var horaFinal = String(FeriadoParcial).substr(posParcial + 5, 4);
  if ((horaInicial < horaHoje) && (horaHoje < horaFinal)) {
    aplFeriado = true;
    logger.info('É Feriado Parcial');
  }
}


if (!aplFeriado) {
  logger.info('Nao é feriado');
  logger.info('Verifica Feriado Estadual');
  posFeriado = String(FeriadoEstadual).indexOf(diaHoje);
  if (posFeriado >= 0) {
    logger.info('Feriado Estadual encontrado: ' + FeriadoEstadual.substr(posDia, 4));
    aplFeriadoEstadual = true;
    if (FeriadoEstadual.length > (posDia + 7)) { //ddMM-seg
      auxRetornoFeriado = String(FeriadoEstadual).substr(posDia + 1);
      auxRetornoFeriado = String(auxRetornoFeriado).toUpperCase();
      if (auxRetornoFeriado.indexOf('SEG') >= 0) {
        aplRetornoFeriado = 'SEGUNDA';
      } else if (auxRetornoFeriado.indexOf('TER') >= 0) {
        aplRetornoFeriado = 'TERCA';
      } else if (auxRetornoFeriado.indexOf('QUA') >= 0) {
        aplRetornoFeriado = 'QUARTA';
      } else if (auxRetornoFeriado.indexOf('QUINTA') >= 0) {
        aplRetornoFeriado = 'QUINTA';
      } else if (auxRetornoFeriado.indexOf('SEX') >= 0) {
        aplRetornoFeriado = 'SEXTA';
      } else if (auxRetornoFeriado.indexOf('SAB') >= 0) {
        aplRetornoFeriado = 'SABADO';
      } else if (auxRetornoFeriado.indexOf('DOM') >= 0) {
        aplRetornoFeriado = 'DOMINGO';
      }
    }
  } else {
    //verifica feriado municipal
    logger.info('Verifica Feriado Municipal');
    posFeriado = String(FeriadoMunicipal).indexOf(diaHoje);
    if (posFeriado >= 0) {
      logger.info('Feriado Municipal encontrado: ' + FeriadoMunicipal.substr(posDia, 4));
