function toHex(str) {
  var hex = '';
  for(var i=0;i<str.length;i++) {
    hex += ''+str.charCodeAt(i).toString(16);
  }
  return hex;
}

function addZero(str) {
  for(var i = str.length; i < 11; i++) { // enquanto parametro for menor que 11 (cpf), adiciona 0 a esquerda
    str = '0' + str;
  }
  return str;
}

